import React from 'react';
import '../App.css';

const MainContainer = () => {
    return (
        <div className="wrap">
            <div className="main">
                <div className="leftaside"></div>
                <aside>
                    <h1>헐헐</h1>
                </aside>
            </div>
        </div>
    );
};

export default MainContainer;
